import React from 'react';
import { ListItem, ListItemText, IconButton } from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import VisibilityIcon from '@mui/icons-material/Visibility';

function TodoItem({ todo, deleteTodo, setOpenEditDialog, setEditTodoId, setEditTodoTitle, setViewTodo }) {
  const handleEditClick = () => {
    setEditTodoId(todo.id);
    setEditTodoTitle(todo.title);
    setOpenEditDialog(true);
  };

  const handleViewClick = () => {
    setViewTodo(todo.id)
  };

  return (
    <ListItem>
      <ListItemText primary={todo.title} />
      <IconButton edge="end" onClick={handleEditClick} color="primary">
        <EditIcon />
      </IconButton>
      <IconButton edge="end" onClick={() => deleteTodo(todo.id)} color="secondary">
        <DeleteIcon />
      </IconButton>
      <IconButton edge="end" onClick={handleViewClick} color="default">
        <VisibilityIcon />
      </IconButton>
    </ListItem>
  );
}

export default TodoItem;
